【商品名】AM216 ウインカー用LED<br />
<br />
【形状】<br />
T20 （WX3×16d） <br />
S25s180°（s25・BA15s） <br />
S25 150°（s25・BAU15s）<br />
<br />
【光色】アンバー <br />
【LED構成】<br />
　SAMSUNG 5730SMD×12個<br />
　CREE XLamp XB-D×1個 <br />
<br />
【定格入力電圧】DC12V (普通車)<br />
【商品内容】1セット2球入り <br />
【保証期間】発送日より、3ヶ月間 <br />
【初期不良対応期間】発送日より、7営業日まで<br />
<br />
【商品について】<br />
　極性：無極性<br />
　適用：ウインカー球<br /> 
・純正球にほぼ同サイズだから、取付スペースが狭いお車にも装着可能。
<br />
・信頼の厚い実績のある「CREE」社と「SUMSANG」社のLEDチップを搭載。<br />
・LEDのシャープな輝きとキレのある輝きを是非、お試しください。<br />
<br />
※ウインカーランプ（球）をLED化にされたらハイフラ現象になります。 <br />
純正リレーをハイフラ防止ICウインカーリレーと交換や、LED抵抗器の使用でハイフラ現象は解消されます。 <br />
（リレーの種類や抵抗器であるかどうかは、車種によって異なりますので、ディーラー様にお問い合わせください。）<br />
※輸入車には適合しておりません。<br /><br />
<br />
■1年保証のLEDウインカーなら、「レダ」<br /><br />
